import React from "react";


function MircosoftDownloadBtn(){
    return <button type="button" id="DownloadBtn" className="btn btn-dark"><p id="supOfMircoBtn">Get it from</p><img src="microsoft.png" id="Img" /><h5 id="buttonHeading"> Mircosoft</h5></button>;
}

export default MircosoftDownloadBtn;
